import React, { useState } from "react";

function App() {
  let [amount, changeAmount] = useState(0);

  function Increment(){
    changeAmount(amount++);
  }

  function Dicrement(){
    changeAmount(amount--);
  }

  return (
    <div className="App">
    </div>
  );
}

export default App;
